  false,\n\t\"url\": null,\n\t\"notes\": \"An interim action plan is presented to
  guide the 1979 management of the Kenai National Moose Range's portion of the lower
  Russian River and its confluence with the Kenai River. The plan shall be an interim
  management guide to be replaced, hopefully by 1980, with a cooperative management
  plan with the Chugach National Forest. This plan specifically acknowledges the closely
  related public use management problems of both Chugach National Forest and Kenai
  National Moose Range.  It is also hoped that the information and results of these
  interim measures will assist in preserving all future options for development of
  a permanent strategy for the area.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
